import React, { Component } from "react";
import "./assets/style.css";
import axios from 'axios';



class Profil extends Component {

  constructor(props){
    super(props);
    this.state = {
        posts: []
    };
  }


  componentDidMount(){
    axios.get('http://localhost:6200/users/profile',{headers : localStorage.getItem("auth-token")})
    .then(response=>{
      this.setState({posts: response.data})
       })
    .catch(error =>{
      console.log(error)
    })



    }

  render(){

    return (
      <div className="username">
          <label htmlFor="exampleInputEmail1">Username</label>
          <input name="username" value={this.state.posts} type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter username" />
          </div>
      )
      }
     }


export default Profil;
